-- CREATE'S --
CREATE TABLE "APP_USER"
(
    "ID"               NUMBER   NOT NULL AUTO_INCREMENT,
    "USERNAME"         VARCHAR2 NOT NULL UNIQUE,
    "PASSWORD"         VARCHAR2 NOT NULL,
    "ENABLED"          BOOLEAN  NOT NULL DEFAULT TRUE,
    "ACCOUNT_EXPIRED"  BOOLEAN  NOT NULL DEFAULT FALSE,
    "ACCOUNT_LOCKED"   BOOLEAN  NOT NULL DEFAULT FALSE,
    "PASSWORD_EXPIRED" BOOLEAN  NOT NULL DEFAULT FALSE,
    "VERSION"          NUMBER   NOT NULL,
    CONSTRAINT "APP_USER_PK" PRIMARY KEY ("ID")
);

CREATE TABLE "APP_ROLE"
(
    "ID"          NUMBER   NOT NULL AUTO_INCREMENT,
    "AUTHORITY"   VARCHAR2 NOT NULL,
    "DESCRIPTION" VARCHAR2 NOT NULL,
    "PROJECT"     VARCHAR2 NOT NULL,
    "VERSION"     NUMBER   NOT NULL,
    CONSTRAINT "APP_ROLE_PK" PRIMARY KEY ("ID")
);

CREATE TABLE "APP_USER_ROLE"
(
    "ID_USER" NUMBER NOT NULL,
    "ID_ROLE" NUMBER NOT NULL,
    CONSTRAINT "APP_USER_ROLE_PK" PRIMARY KEY ("ID_USER", "ID_ROLE"),
    CONSTRAINT "APP_USER_ROLE_USER_FK" FOREIGN KEY ("ID_USER") REFERENCES "APP_USER" ("ID"),
    CONSTRAINT "APP_USER_ROLE_ROLE_FK" FOREIGN KEY ("ID_ROLE") REFERENCES "APP_ROLE" ("ID")
);

CREATE TABLE "MOVIE"
(
    "ID"          NUMBER   NOT NULL AUTO_INCREMENT,
    "COVER"       BLOB     NOT NULL,
    "TITLE"       VARCHAR2 NOT NULL,
    "DIRECTOR"    VARCHAR2 NOT NULL,
    "DURATION"    NUMBER   NOT NULL,
    "RELASE_DATE" DATE     NOT NULL,
    CONSTRAINT "MOVIE_PK" PRIMARY KEY ("ID")
);

CREATE TABLE "ROOM"
(
    "NUMBER"       NUMBER NOT NULL,
    "CAPACITY"     NUMBER NOT NULL,
    "DISTRIBUTION" VARCHAR2 NOT NULL,
    CONSTRAINT "ROOM_PK" PRIMARY KEY ("NUMBER")
);

CREATE TABLE "SCHEDULE"
(
    "ID"        NUMBER   NOT NULL AUTO_INCREMENT,
    "DATE_TIME" DATETIME NOT NULL,
    "MOVIE"     NUMBER   NOT NULL,
    "ROOM"      NUMBER   NOT NULL,
    CONSTRAINT "SCHEDULE_PK" PRIMARY KEY ("ID"),
    CONSTRAINT "SCHEDULE_NOVIE_FK" FOREIGN KEY ("MOVIE") REFERENCES "MOVIE" ("ID"),
    CONSTRAINT "SCHEDULE_ROOM_FK" FOREIGN KEY ("ROOM") REFERENCES "ROOM" ("NUMBER")
);

CREATE TABLE "RESERVATION"
(
    "ID"       NUMBER NOT NULL AUTO_INCREMENT,
    "USER"     NUMBER NOT NULL,
    "SCHEDULE" NUMBER NOT NULL,
    "QUANTITY" NUMBER NOT NULL,
    CONSTRAINT "RESERVATION_PK" PRIMARY KEY ("ID"),
    CONSTRAINT "RESERVATION_APP_USER_FK" FOREIGN KEY ("USER") REFERENCES "APP_USER" ("ID"),
    CONSTRAINT "RESERVATION_SCHEDULE_FK" FOREIGN KEY ("SCHEDULE") REFERENCES "SCHEDULE" ("ID")
);

